INGREDIENTS
▶️2 cups sugar
▶️2 cups water ▶️Sprigs of fresh mint
▶️Crushed ice
▶️Old Forester Straight Bourbon Whisky

INSTRUCTIONS
 
The night before you want to drink Mint Juleps 🌚
In a medium sauce pan, add the sugar and water and bring to a boil. Simmer for 5 minutes, stirring often.
